import React from 'react';

const FlipCard = (props) => {
    const style = {
        color: 'white',
    };

    return (
        <div className="container">
            <div className="card-wrapper">
                <div className="front face">
                    {props.frontContent}
                </div>
                <div className="back face">
                    {props.backContent}
                </div>
            </div>
        </div>
    );
}

export default FlipCard;
